import React from 'react';

import style from './MealItem.module.css';

const MealItem = ({id, name, description, price}) => {
    return (
        <li key={id}>
            <div>
                <h3>{name}</h3>
                <div>{description}</div>
                <div>{price}</div>
            </div>
            <div></div>
        </li>
    )
}

export default MealItem;
